import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div>kaitlyn's site!</div>
      </header>
      <div className="row">
        <div className="column1">column 1!
          <div className="nav-list"></div>
        </div>
        <div className="column2">column 2!</div>
      </div>
    </div>
  );
}

export default App;
